  state = {
    correctAnswers: null
  };
  render() {
    return (
      <div style={{maxWidth: '700px', margin: '0 auto'}}>
        <h1>Totally Trivia</h1>
        <Questions />
      </div>
    );
  }
}
export default Trivia;
